  //     chartExample1Data:
  //       this.state.chartExample1Data === "data1" ? "data2" : "data1",
  //   });
  // };
  render() {
    return (
      <>
        <Header />
        {/* Page content */}
        <Container className="mt--7" fluid></Container>
      </>
    );
  }
}

export default Index;
